import React from "react";
import whatsappImg from './assets/whatsapp.png'

const WhatsappLogo =()=>{
    return(
        <>
        <div className="whatsapp-button">
            <img src={whatsappImg}></img>
        </div>
        </>
    )
}

export default WhatsappLogo;
